import './ExpenseItem.css'


const ExpenseItem = (props) => {
  return (
<div >
    <h1 class="travel">{props.title}</h1>
     <p class="mny">{props.date.toISOString()}</p>
 </div>
  );
};
export default ExpenseItem;
